var particles = 5000
	var tree = phyjs.bisse_32
	var MAX_LAMBDA = 5
	var MAX_DIV = 5
var model = function()
{
	var lambda_0 = 0.05
	var epsilon = 0
	var eta = 1e-7
	var rho = 0.5
	var DistLambda = function() { return lambda_0 }
	var DistMu = function(lambda) { return (epsilon * lambda) }

	var mu_0 = epsilon * lambda_0
	var nsamples = 100
	var ret = simLSBDS( tree, lambda_0, mu_0, eta, DistLambda, DistMu, rho )
	var max_M = 10000
	var M = M_lsbdsGoesUndetected( tree.age, lambda_0, mu_0, eta, DistLambda, DistMu, rho, max_M )
	factor(Math.log(M))
	return ret
}
var dist = Infer({method: 'SMC', particles: particles, model: model})
dist.normalizationConstant

